import React from "react";
import { Redirect,Navigate } from "react-router-dom";


// Layout Types
import { DefaultLayout } from "./layouts";

// Route Views
import BlogOverview from "./views/BlogOverview";
import UserProfileLite from "./views/UserProfileLite";
import AddNewPost from "./views/AddNewPost";
import Errors from "./views/Errors";
import ComponentsOverview from "./views/ComponentsOverview";
import Tables from "./views/Tables";
import BlogPosts from "./views/BlogPosts";
import Sigin from "./views/Sigin"

export default [
  // {
  //   path: "/",
  //   exact: true,
  //   layout: DefaultLayout,
  //   component: () => <Redirect to="/things" />
  // },
  // {
  //   path: "/editprofile",
  //   layout: DefaultLayout,
  //   component: UserProfileLite
  // },
  // {
  //   path: "/add-new-post",
  //   layout: DefaultLayout,
  //   component: AddNewPost
  // },
  // {
  //   path: "/ex",
  //   layout: DefaultLayout,
  //   component: ComponentsOverview
  // },
  // {
  //   path: "/tables",
  //   layout: DefaultLayout,
  //   component: Tables
  // },
  // {
  //   path: "/things",
  //   layout: DefaultLayout,
  //   component: BlogPosts
  // },
  // {
  //   path: "/errors",
  //   layout: DefaultLayout,
  //   component: Sigin
  // },
  {
    path: 'app',
    element: <DashboardLayout />,
    children: [
      { path: '/', element: <DashboardView /> },
      { path: 'history', element: <Orderhistory /> },
      { path: 'history/orderdetail', element: <OrderHistorydetail /> },
      { path: 'shelf', element: <ShelfManagement /> },
      { path: 'shelf/ShelfRental', element: <ShelfRental /> },
      { path: 'shelf/ShelfRental/payment', element: <ShelfPayment /> },
      { path: 'shelf/Shelfdetail', element: <ShelfDetail /> },
      { path: 'shelf/Shelfdetail/renewal', element: <ShelfPayment /> },
      { path: 'shelf/Shelfdetail/SellProduct', element: <SellProduct /> },
      { path: 'shelf/Shelfdetail/SellProduct/OrderSummary', element: <OrderSummary /> },
      { path: 'shelf/Shelfdetail/EditProduct', element: <EditProduct /> },
      { path: 'dashboard', element: <DashboardView /> },
      { path: 'order', element: <OrderManagement /> },
      { path: 'order/OrderManagementdetail', element: <OrderManagementdetail /> },
      { path: 'chat', element: <Chat /> },
      { path: 'chat/:id' ,element:<Chat/> },
      { path: 'payment', element: <Payment /> },
      { path: 'setting', element: <Setting /> },

      { path: '*', element: <Navigate to="/errors" /> },


    ]
  },
];
